import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./tem.css";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
function Page1() {
    return (
        <div>
            <Navbar collapseOnSelect expand="lg" className='bg-img' data-bs-theme="dark">
      <Container>
        <Navbar.Brand href="#home" className='head'>GrandCoff</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-end">
          <Nav>
            <Nav.Link href="#Home.jsx" className='nav'>Home</Nav.Link>  
             <Nav.Link href="#page2" className='nav'>About Us</Nav.Link>
              <Nav.Link href="#pricing" className='nav'>Gallery</Nav.Link>
              <Nav.Link href="#pricing" className='nav'>Services</Nav.Link>
             <Nav.Link href="#pricing" className='nav'>Contact Us</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
           </div>

    )
}
export default Page1;
